import Item from '../item';


function Vitrine({ produtos }) {
    return (
        <div className="produtos">
            <div className="products">
                {produtos.map((item) =>
                    <Item key={item.id} nome={item.name} categoria={item.category} preco={item.price} img={item.img} />
                )}
            </div>
        </div>
    );

}


export default Vitrine
